CREATE TABLE IF NOT EXISTS `rule_set_component` (
  `date_modified` timestamp NOT NULL default CURRENT_TIMESTAMP,
  `date_created` timestamp NOT NULL default '0000-00-00 00:00:00',
  `active_status` enum('active','inactive') NOT NULL default 'active',
  `rule_set_id` int(10) unsigned NOT NULL default '0',
  `rule_component_id` int(10) unsigned NOT NULL default '0',
  `sequence_no` smallint(5) unsigned NOT NULL default '0',
  PRIMARY KEY  (`rule_set_id`,`rule_component_id`),
  KEY `idx_rule_set_comp_setid_seqno` (`rule_set_id`,`sequence_no`)
);
